var routeStyle = {
    "color" : "#FF6D00",
    "weight" : 5
};

var completedStyle = {
    "color" : "#03A9F4",
    "weight" : 5
};

var map = L.mapbox.map('map', 'mapbox.light');

var routeLine = L.geoJson(routeGeoJSON, {
    style: routeStyle
}).addTo(map);

var completeLine = L.geoJson(completedGeoJSON, {
    style: completedStyle
}).addTo(map);

var milestonesLayer = L.mapbox.featureLayer().addTo(map);

milestonesLayer.on('layeradd', function(e) {
   var marker = e.layer,
       feature = marker.feature;
    marker.setIcon(L.icon(feature.properties.icon));
});

milestonesLayer.setGeoJSON(positionMarkers);

milestonesLayer.on('mouseover', function(e) {
    e.layer.openPopup();
});

milestonesLayer.on('mouseout', function(e) {
    e.layer.closePopup();
});


map.fitBounds(routeLine.getBounds());
